import React from 'react';
import './index.css';
import Card from './Card';

export default class Index extends React.Component {
  render() {
    return (
      <div>
        <header className="App-header">
          <img 
            src="/static/logo.png" 
            className="static-logo"
            alt=""
            />
        </header>  
        <div className="Grid">
          <Card />    
          <Card />    
          <Card />    
        </div>
      </div>
    );
  }
}
